<script type="text/javascript">
    var searchData = {
        title: '好打造洁净环境，享受优质生活'
        , desc: '帮家洁高品质家政平台，自己用省钱，分享能赚钱'
        , link: 'http://jiajie-touch.7dugo.com/#/share?userid=<?php echo $a_view_data['user_id'];?>'
        , imgUrl: 'http://www.7dugo.com/image/logo_h.png'
    };

    $(function () {
        if (!isWeiXin()) {
            alert('您当前不是微信浏览器，请在微信中打开!');
        }
        var clipboard = new ClipboardJS('#copyBtn', {
            text: function () {
                return searchData.link;
            }
        });
        clipboard.on('success', function (e) {
            alert("复制成功");
        });

        setRem(window, {
            designWidth: 750,
            designFontSize: 100
        });

        var url = location.href.split('#').toString();
        $.ajax({
            type: 'get'
            , url: 'http://www.7dugo.com/wechat.get.sign.package?url=' + url
            , success: function (data) {
                if (data.error == 0) {
                    var _data = data.data;
                    wx.config({
                        debug: false,////生产环境需要关闭debug模式
                        appId: _data.appId,//appId通过微信服务号后台查看
                        timestamp: _data.timestamp,//生成签名的时间戳
                        nonceStr: _data.nonceStr,//生成签名的随机字符串
                        signature: _data.signature,//签名
                        jsApiList: [//需要调用的JS接口列表
                            // 'checkJsApi',//判断当前客户端版本是否支持指定JS接口
                            'onMenuShareTimeline',//分享给好友
                            'onMenuShareAppMessage'//分享到朋友圈
                        ]
                    });
                    wx.ready(function () {
                        wx.onMenuShareTimeline(searchData); //分享到朋友圈
                        wx.onMenuShareAppMessage(searchData); //分享到朋友
                        //检查微信接口是否调用成功
                        /* wx.checkJsApi({
                             jsApiList: ['onMenuShareTimeline', 'onMenuShareAppMessage'], // 需要检测的JS接口列表，所有JS接口列表见附录2,
                             success: function (res) {
                                 // 以键值对的形式返回，可用的api值true，不可用为false
                                 // 如：{"checkResult":{"chooseImage":true},"errMsg":"checkJsApi:ok"}
                                 if (res.checkResult)
                             }
                         });*/
                    });
                }
            }
        })
    });

    function isWeiXin() {
        var ua = window.navigator.userAgent.toLowerCase();
        return ua.match(/MicroMessenger/i) == 'micromessenger';
    }

    function setRem(win, option) {
        var count = 0
        var designWidth = option.designWidth
        var designHeight = option.designHeight || 0
        var designFontSize = option.designFontSize || 20
        var callback = option.callback || null
        var root = document.documentElement
        var rootWidth
        var newSize
        var t
        show()

        // 返回root元素字体计算结果
        function _getNewFontSize() {
            var winWidth = win.innerWidth > 800 ? 800 : win.innerWidth
            var scale = designHeight !== 0 ? Math.min(winWidth / designWidth, win.innerHeight / designHeight) : winWidth / designWidth

            // 750px
            // return scale * designFontSize;
            // 375px
            return scale * designFontSize * 2     // 字体的倍速，对应的是designFontSize: 100,
        }

        function show() {
            var winWidth = win.innerWidth > 800 ? 800 : win.innerWidth

            rootWidth = root.getBoundingClientRect().width

            // 如果此时屏幕宽度不准确，就尝试再次获取分辨率，只尝试20次，否则使用win.innerWidth计算
            if (rootWidth !== winWidth && count < 20) {
                win.setTimeout(function () {
                    count++
                    show()
                }, 0)
            } else {
                newSize = Math.floor(_getNewFontSize())
                // 如果css已经兼容当前分辨率就不管了
                if (newSize + 'px' !== getComputedStyle(root)['font-size']) {
                    root.style.fontSize = newSize + 'px'
                    return callback && callback(newSize)
                }
            }
        }

        // 横竖屏切换的时候改变fontSize，根据需要选择使用
        win.addEventListener('onorientationchange' in window ? 'orientationchange' : 'resize', function () {
            clearTimeout(t)
            t = setTimeout(function () {
                show()
            }, 200)
        }, false);
    }
</script>
